// App.js

import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import NavBar from './Nav';
import Login from './Login';
import Game from './game';
import Level from './Level';
import Register from './Register';
import Profile from './Profile';
import Leaderboard from './Leaderboards';
import Stats from './Stats';
import GameLevelTwo from './GameLevelTwo';
import { BackgroundProvider } from './BackgroundContext'; // Import BackgroundProvider
import History from './History';
const App = () => {
  return (
    <Router>
      <BackgroundProvider> {/* Move BackgroundProvider outside of Routes */}
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route
            path="/levels"
            element={
              <>
                <NavBar />
                <Level />
              </>
            }
          />
          <Route
            path="/game"
            element={
              <>
                <NavBar />
                <Game />
              </>
            }
          />
          <Route
            path="/profile"
            element={
              <>
                <NavBar />
                <Profile />
              </>
            }
          />
          <Route
            path="/leaderboard"
            element={
              <>
                <NavBar />
                <Leaderboard />
              </>
            }
          />
          <Route
            path="/stats"
            element={
              <>
                <NavBar />
                <Stats />
              </>
            }
          />
          <Route
            path="/gametwo"
            element={
              <>
                <NavBar />
                <GameLevelTwo />
              </>
            }
          />
           <Route
            path="/"
            element={
              <>
                <NavBar />
                <GameLevelTwo />
              </>
            }
          />
        </Routes>
      </BackgroundProvider>
    </Router>
  );
};

export default App;
